import math

def calculate_maximal_logo_sizes(X):
    if X <= 12:
        return (0, 0)
    x = int((-4 + math.sqrt(16 + 32 * X)) / 16.0)
    xplus = int((-12 + math.sqrt(16 + 32 * X)) / 16.0)
    if 8 * pow(x, 2) + 4 * x > 8 * pow(xplus, 2) + 12 * xplus + 4:
        return (2 * x - 1, 2 * x)
    else:
        return (2 * xplus + 1, 2 * xplus)

